8.1.2

**Describe the bug:**

Logs ingested through the Elastic OTLP intake are categorized as "unknown" in the ""

![image](https://user-images.githubusercontent.com/459691/162414774-4a75cd2f-e773-4af8-905e-caf53c10b596.png)


**Steps to reproduce:**

1. Collect logs through the Elastic OTLP intake
2. Verify that logs messages are flowing in the `ds-logs-apm.app-default-*` indices
3. Navigate to the Observability Overview page

**Expected behavior:**

The log trends of the Observability page should report the logs ingested through the OTLP intake with a meaningful category to be defined but today it reports `unknown`.

I propose to report as the generic category "OTLP" or "OpenTelemetry" rather than trying to refine the type of log (application layer, infra layer...)

**Screenshots (if relevant):**
![image](https://user-images.githubusercontent.com/459691/162420182-82a566af-f9b9-4b0f-98b8-badaf395e799.png)

